  input: '"TEXT","F3A","C00345090","Please note the following changes have been made
    to this report: Column B figures for the summary and detailed summary page information
    should equal the sum of the Column B figures on our pervious report and the Column
    A figures on this report minus the Column C figures.  The disbursements to credit
    card companies have been corrected by itemizing each vendor that has an aggregate
    in excess of $200.00 as a memo entry.  The purpose for the disbursement to Eli
    Lilly has been corrected to reflect Fundraiser.  The contributions that were incorrectly
    designated to the Primary have been re-designated to reflect General election.  The
    contribution of $1,000 on 11/26/02 has been re-designated to 10/23/02 for the
    02 General Election cycle.  On April 26, 2001 we received a contribution of $5,000
    from the National Association of Home Builders and designated this receipt to
    the 02 Primary. We received additional contributions on November 19, 2001 ($500)
    and May 8, 2002 ($3,000).  These contributions were designated to the 02 General.  On
    October 23, 2002 we received a contribution of $2,500. We reported a 48-Hour notice
    reflecting we received the full $2,500.  Our FEC report for the 30 day post general
    reported $1,500 to the 02 General.  Our intention was to refund the excessive
    amount ($1,000) that we thought put us over the limit.  However, after speaking
    with BuildPACs Director about issuing the refund, he informed us that the contribution
    on April 26, 2001 of $5,000 was, in fact, a $1,000 contribution to 2000 Debt Retirement
    and a $4,000 contribution to the 02 Primary.  Realizing the October 23rd contribution
    of $2,500 would not put us over the limit, the additional  $1,000 was reported
    on November 26, 2002, designated for the 02 General, and reflected in the 02 year
    end report.  The Mid-Year of 2001 report has been amended to reflect the re-designation
    changes."'
